import React from 'react';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '10px', /* Added padding */
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  aboutSection: {
    marginTop: '20px', /* Adjusted margin */
    marginBottom: '75px',
    textAlign: 'left', /* Aligned to left */
    paddingLeft: '20px', /* Added left padding */
  },
  introductionHeading: {
    fontSize: '2rem', /* Increased font size */
    fontWeight: 'bold',
    color: '#333', /* Changed color */
  },
  introductionContent: {
    fontSize: '1.2rem',
    color: '#555',
  },
};

const Header = () => (
  <header style={styles.header}>
    {/* Removed website name */}
  </header>
);

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>About Us</li>
      <li style={styles.navLi}>Clubs</li>
      <li style={styles.navLi}>Contact Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const AboutSection = () => (
  <div style={styles.aboutSection}>
    <div>
      <h1 style={styles.introductionHeading}>Introduction</h1>
      <p style={styles.introductionContent}>This is the introduction</p>
    </div>
  </div>
);

const App = () => (
  <div style={styles.app}>
    <Header />
    <NavBar />
    <AboutSection />
    {/* Include other components and sections as needed */}
  </div>
);

export default App;
